    Small input
  </label>
  <div>
    <input
      type="text"
      id="small-input"
      class="block w-40 p-2 text-gray-900 border border-gray-300 rounded-lg bg-gray-50 sm:w-32 sm:p-1 sm:text-xs focus:ring-blue-500 focus:border-blue-500"></input>
    
  </div>
</div>

    </div>
  );
};

